import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Hello from "./component/Hello/Hello";
import Counter from "./component/Counter/Counter";

function App() {
  return (
    <div>
      <Hello name="adit" />
      <br></br>
      <Hello name="didit" />
      <br></br>
      <Hello name="dodot" />
      <br></br>
    </div>
  );
}

export default App;
